import {request} from "./request";

export function getSalers(page) {
    return request({
        url:`/salers/${page}`,
        method:'get',
    })
}

export function deleteSalersById(id) {
    return request({
        url:`/salers/${id}`,
        method:'delete',
    })
}

export function betchDeleteSalersById(data) {
    return request({
        url:'/salers/batchDelete',
        method:'delete',
        data: JSON.stringify(data)
    })
}
